import React from 'react';
import Header from '../components/Home/Header';
import Menu from '../components/Home/Menu';
import Footers from '../components/Home/Footers';
import './Home.css';

const Home = () => {
  const backgroundImageUrl = 'url("path/to/your/image.jpg")';

  return (
    <div className="App1" style={{ backgroundImage: backgroundImageUrl }}>
      <Header />
      <Menu />
      <Footers />
    </div>
  );
};

export default Home;
